import React from "react";
import Item from "./Item";
import ItemCount from "../ItemCount";

export const ItemDetail = (props) => {
  const smartwatches = props;
  const count = ItemCount.count;

  return (
    <>
      <div className="row">
        <div className="smartwatches-container">
          <Item {...smartwatches} />

          <div className="addCart">
            <ItemCount stock={5} initial={1} />
            {/* <button className="btn" onClick={() => addCart()}>
              Agregar al carrito {props.count}
            </button> */}
            <button className="btn">Agregar al carrito {count}</button>
          </div>
        </div>
      </div>
    </>
  );
};

export default ItemDetail;
